import React from 'react';
import { useState } from 'react';
import { Link } from 'react-router-dom';
import styles from './Login.module.scss';

export const Login = () => {
    const [email, setEmail] = useState('')
    const [pasw, setPasw] = useState('')


    fetch('https://society-capital.herokuapp.com/api/login', {
        'mode': 'no-cors',
        'Accept': 'application/json',
        'method': 'GET',
        'headers': {
            'Authorization': 'Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJzdWIiOiJhbGVrc2V5Iiwicm9sZXMiOlsiUk9MRV9BRE1JTiJdLCJpc3MiOiJodHRwczovL3NvY2lldHktY2FwaXRhbC5oZXJva3VhcHAuY29tL2FwaS9sb2dpbiIsImV4cCI6MTY2MzAxMzQzMH0.CHvjV-sHmIOLKZ-ngeeab1ekOz4C8B1X5KGUfUMRyec'
        },
    })


    return (
        <div className={styles.wrapper}>
            <div className={styles.container}>
                <div className={styles.content}>
                    <div className={styles.text}>
                        Sign in
                    </div>
                    <div className={styles.form}>
                        <input autoComplete='off' placeholder='Email' value={email} onChange={event => setEmail(event.target.value)}></input>
                        <input autoComplete='off' placeholder='Password' value={pasw} onChange={event => setPasw(event.target.value)}></input>
                    </div>
                    <button onClick={undefined}>Submit</button>
                    <hr></hr>
                    <div className={styles.signUp}>
                        Don't have an account?
                        <Link to='signup'><button>Sign up</button></Link>
                    </div>
                    <div className={styles.forgot}>
                        <Link to='/not-found'>Forgot your password?</Link>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Login;
